import {Button, Grid, Typography, IconButton} from "@mui/material";
import basquiaPulito from "./imgs/basquiaPulito.png";
import React from "react";
import './App.css';
import KeyboardBackspaceIcon from '@mui/icons-material/KeyboardBackspace';

const MainPage = () => {


    return (
        <Grid container className="App-header">
            <Grid container direction="row">
                <Grid item xs={2} display="flex" justifyContent="center" alignItems="center">
                    <IconButton>LOGOUT</IconButton>
                </Grid>
                <Grid item xs={10} display="flex" justifyContent="center" alignItems="center">
                    <Typography style={{color: 'white', textAlign: 'center', fontSize: '2rem'}}>BENVENUTO USER</Typography>
                </Grid>
            </Grid>
        </Grid>
    );

}

export default MainPage;
